import React from "react";
import { useSelector } from "react-redux";
import "./List.css";
function List() {
  const listitems = useSelector((state) => state.shop.itemlist);
  console.log(listitems);
  return (
    <div className="list-container">
      {listitems.length === 0 ? (
        <p className="noList"> No Shops To Show</p>
      ) : (
        <div>
          <ul>
            {listitems.map((item, index) => {
              return (
                <>
                  <li>Prathamesh Shop</li>
                  <li>Grocery</li>
                  <li>Mumbai</li>
                  <li>12/23/12</li>
                  <li>12/21/12</li>
                  <button>delete</button>
                </>
              );
            })}
          </ul>
        </div>
      )}
    </div>
  );
}

export default List;
